import React from "react";
import listItemsData from "../data/ThirdLessonData";

const List = (listItemsData) => {
  return (
    <ul>
      console.log(listItemsData)
      {listItemsData.map((surname) => (
        <li key={surname}>{surname}</li>
      ))}
    </ul>
  );
};

export default List;
